import './App.css';
import Home from "./Home";
import Header from "./Header";
import Checkout from "./Checkout"
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';




function App() {
  return (
    <div className="App">
      <Router>
      <Header/>

      <Routes>
        <Route path ="/checkout" element ={<Checkout/>}/>
        <Route path ="/" element ={<Home/>}/>

      </Routes>
      </Router>

      <Home/>
    </div>
  );
}

export default App;
